import React from 'react';
// import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
// import { useDispatch } from 'react-redux';
// import { useHistory } from 'react-router-dom';
import Layout from '../Templates/Layout';

function InterviewPage() {
//   const dispatch = useDispatch();
//   const history = useHistory();

  return (
    <Layout>
      <div className="inner-flex-top vert-center-sm">
        <div className="main-50">
          <div className="container fixed-bg-2 text-center">
            <h3 className="display-5">Question</h3> 

            <p className="pt-1">"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum."</p>

          </div>
        </div>
        <div className="aside-50">
          <div className="container fixed-bg-2 text-center">
            {/* <h1 className="display-4 pb-5">PeerPrep</h1> */}
            <img className="small-icon" src="/education.png" alt="Start" />
            <h3 className="pt-3">Choose your difficulty:</h3>

            <Button
              variant="primary"
              className="mt-4 pp-button"
              name="Easy"
              // onClick={(e) => handleShow(e.target.name)}
            >
              Easy
            </Button>
            <br />

            <Button
              variant="primary"
              className="mt-3 pp-button"
              name="Medium"
              // onClick={(e) => handleShow(e.target.name)}
            >
              Medium
            </Button>
            <br />

            <Button
              variant="primary"
              className="mt-3 pp-button"
              name="Hard"
              // onClick={(e) => handleShow(e.target.name)}
            >
              Hard
            </Button>
          </div>
        </div>
      </div>
    </Layout>
  );
}

export default InterviewPage;
